package com.amandris.clients.service.vo;import java.io.Serializable;public class SellerService implements Serializable{	private Integer 	id;	private Integer 	sellerId;	private Integer 	serviceTypeConst;	private Integer 	sexConst;	private Double  	serviceFirstHourPrice;	private Double  	serviceAdditionalHoursPrice;	private Integer		currencyConst;	private Seller 		seller;	private Integer		toAsk;		private static final long serialVersionUID = 6526471155622776019L;		public Integer getId() {		return id;	}	public void setId(Integer id) {		this.id = id;	}	public Seller getSeller() {		return seller;	}	public void setSeller(Seller seller) {		this.seller = seller;	}	public Integer getSellerId() {		return sellerId;	}	public void setSellerId(Integer sellerId) {		this.sellerId = sellerId;	}	public Double getServiceAdditionalHoursPrice() {		return serviceAdditionalHoursPrice;	}	public void setServiceAdditionalHoursPrice(Double serviceAdditionalHoursPrice) {		this.serviceAdditionalHoursPrice = serviceAdditionalHoursPrice;	}	public Double getServiceFirstHourPrice() {		return serviceFirstHourPrice;	}	public void setServiceFirstHourPrice(Double serviceFirstHourPrice) {		this.serviceFirstHourPrice = serviceFirstHourPrice;	}	public Integer getServiceTypeConst() {		return serviceTypeConst;	}	public void setServiceTypeConst(Integer serviceTypeConst) {		this.serviceTypeConst = serviceTypeConst;	}	public Integer getSexConst() {		return sexConst;	}	public void setSexConst(Integer sexConst) {		this.sexConst = sexConst;	}	public Integer getCurrencyConst() {		return currencyConst;	}	public void setCurrencyConst(Integer currencyConst) {		this.currencyConst = currencyConst;	}	public Integer getToAsk() {		return toAsk;	}	public void setToAsk(Integer toAsk) {		this.toAsk = toAsk;	}}